_counter() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"tools":[{"id":"1137"},{"id":"1139"},{"id":"1140"},{"id":"1141"},{"id":"1142"},{"id":"1143"}]},"id":"1130","type":"Toolbar"},{"attributes":{"factors":["a","b"]},"id":"1155","type":"FactorRange"},{"attributes":{},"id":"1297","type":"BasicTicker"},{"attributes":{},"id":"1159","type":"CategoricalScale"},{"attributes":{},"id":"1492","type":"BasicTickFormatter"},{"attributes":{},"id":"1498","type":"Selection"},{"attributes":{"axis":{"id":"1016"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1019","type":"Grid"},{"attributes":{"callback":{"id":"1138"}},"id":"1139","type":"TapTool"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"@type: @bandwidth_text / s"},"id":"1211","type":"HoverTool"},{"attributes":{},"id":"1506","type":"UnionRenderers"},{"attributes":{"high":1,"low":0,"palette":["#ffffFF","#fefeFF","#fdfdFF","#fcfcFF","#fbfbFF","#fafaFF","#f9f9FF","#f8f8FF","#f7f7FF","#f6f6FF","#f5f5FF","#f4f4FF","#f3f3FF","#f2f2FF","#f1f1FF","#f0f0FF","#efefFF","#eeeeFF","#ededFF","#ececFF","#ebebFF","#eaeaFF","#e9e9FF","#e8e8FF","#e7e7FF","#e6e6FF","#e5e5FF","#e4e4FF","#e3e3FF","#e2e2FF","#e1e1FF","#e0e0FF","#dfdfFF","#dedeFF","#ddddFF","#dcdcFF","#dbdbFF","#dadaFF","#d9d9FF","#d8d8FF","#d7d7FF","#d6d6FF","#d5d5FF","#d4d4FF","#d3d3FF","#d2d2FF","#d1d1FF","#d0d0FF","#cfcfFF","#ceceFF","#cdcdFF","#ccccFF","#cbcbFF","#cacaFF","#c9c9FF","#c8c8FF","#c7c7FF","#c6c6FF","#c5c5FF","#c4c4FF","#c3c3FF","#c2c2FF","#c1c1FF","#c0c0FF","#bfbfFF","#bebeFF","#bdbdFF","#bcbcFF","#bbbbFF","#babaFF","#b9b9FF","#b8b8FF","#b7b7FF","#b6b6FF","#b5b5FF","#b4b4FF","#b3b3FF","#b2b2FF","#b1b1FF","#b0b0FF","#afafFF","#aeaeFF","#adadFF","#acacFF","#ababFF","#aaaaFF","#a9a9FF","#a8a8FF","#a7a7FF","#a6a6FF","#a5a5FF","#a4a4FF","#a3a3FF","#a2a2FF","#a1a1FF","#a0a0FF","#9f9fFF","#9e9eFF","#9d9dFF","#9c9cFF","#9b9bFF","#9a
